export default function Project() {
  return (
    <div className="project-section">
      <h2 className="project-title">This is my project</h2>
      <img className="project-img" src="/static/project1.png"/>
      <p className="project-text">
        Consequat irure dolore occaecat reprehenderit anim aliqua tempor fugiat
        ad quis officia duis ipsum. Elit sit et anim ea enim reprehenderit amet
        ullamco excepteur laboris consequat incididunt anim. Eiusmod cupidatat
        non dolore do qui anim consectetur excepteur laboris aute. Commodo ea
        consectetur irure adipisicing non consectetur enim amet qui ad
        reprehenderit labore mollit.
      </p>

      <div className="project-nav">
        <a href="#">View Code</a>
        <a href="#">View App</a>
      </div>

      <style jsx>{`

      .project-section{
        display: grid;
        grid-template-rows: max-content 1fr 500px max-content;
        padding: 1em;

      }


      `}</style>
    </div>
  );
}
